import { Button, Menu, Space } from 'antd';

import {
    HomeOutlined, 
    ShoppingCartOutlined, 
    ExperimentOutlined, 
    SendOutlined,
    HeartOutlined,
    FireOutlined,
    } from '@ant-design/icons';
import React from 'react';

interface MenuItem {
    key: string;
    label: string;
    icon: React.ReactNode;
    type: 'group';
}


let menuOptions: MenuItem[] = [
    {
        key: 'home',
        label: 'Home',
        icon: <HomeOutlined />,
        type: 'group',
    },
    {
        key: 'products',
        label: 'Products',
        icon: <ShoppingCartOutlined />,
        type: 'group',
    },
    {
        key: 'cart',
        label: 'Cart',
        icon: <ExperimentOutlined />,
        type: 'group',
    },
    {
        key: 'contact',
        label: 'Contact',
        icon: <SendOutlined />,
        type: 'group',
    },
    {
        key: 'account',
        label: 'Account',
        icon: <HeartOutlined />,
        type: 'group',
    },
    {
        key: 'forums',
        label: 'Forums',
        icon: <FireOutlined />,
        type: 'group',
    }
]


interface StandardNavbarProps {
    menuChoice: string;
    menuChoiceSetter: (menuChoice: string) => void;
}

export function StandardNavbar({ menuChoice, menuChoiceSetter } : StandardNavbarProps ) {


    return (
        <Space direction='vertical' style={{width: '100%' }}>
            <Menu mode="inline" selectedKeys={[menuChoice]} items={menuOptions}/>
        </Space>
    );
}
